import React from 'react'
 const Card = (prop) => {
  return (
    <div className="menu_card">
      <div className="cards">
        <div className="card">
          <img src={prop.img} alt="" />
          <h3>{prop.title}</h3>
          <h4>{prop.price}</h4>
          <button>{prop.btn}</button>
        </div>
      </div>
    </div>
  )
}

export default Card;
